para sus productos</div><div>11. Reportes de Ventas, Articulos, Vendedores, Kardex, etc.</div><div>12. Configuramos/Formatos: Facturas, Proformas con logos, Comprobantes de Ingreso, Egreso y Diarios y CÃ³digo de barras.</div><div>13. Manejamos hasta 4 precios</div><div>14. Avisos de vencimiento y fechas de caducidad</div><div>15. Se ajusta a sus requerimientos.</div><div>16. Y muchas mÃ¡s...</div><div>Pensando en la economÃ­a de nuestros clientes y queriendo dinamizar el uso de nuestro sistema hemos bajado los precios en un ðŸ´0%, esto gracias a que ahora todo el proceso de instalaciÃ³n y capacitaciÃ³n la realizamos vÃ­a remota (ON LINE mediante Teamviewer o Anydesk ) esto permite trabajar a nivel nacional.</div><div><img width="16" alt="" src="https://static.xx.fbcdn.net/images/emoji.php/v9/td8/1/16/1f4f2.png" height="16">CONTÃCTANOS</div><div><a target="_blank" rel="nofollow" href="https://wa.me/593981573678/%F0%9F%91%88?fbclid=IwZXh0bgNhZW0CMTAAAR2H1rE4uOTjr10R2b6qnp9Pwuyft9h-0tWbg3t-kYfeqLkMSEPDfUWid5E_aem_ZbxV2qvluogRJ5FNs05n1A">https://wa.me/593981573678/<img width="16" alt="" src="https://static.xx.fbcdn.net/images/emoji.php/v9/td0/1/16/1f448.png" height="16"></a></div><div><img width="16" alt="" src="https://static.xx.fbcdn.net/images/emoji.php/v9/t8c/1/16/1f4bb.png" height="16"> Facebook:</div><div><img width="16" alt="" src="https://static.xx.fbcdn.net/images/emoji.php/v9/taa/1/16/1f310.png" height="16"><a target="_blank" rel="nofollow" href="https://www.facebook.com/dieday.ec?__cft__[0]=AZXod_40PUIxTfdA9o6rBr-p8Mm7-KBQ6tWE4CODeZDyMm7Qt61QlCXD0Thl3e_S8mvWy8qqC3EuSc414yLWo6sgQ3iOzlXCdmmDrJilqFBRkPtBt8kmVRloMkcGpeFNOgU9X7oa0Z1TBqRlqCHYFC0vht7XOFi775XzYSeOPXOVfiRF51F45od7_EWQHx4WLDvYrxUUhNvTPjsqATbz75hk&amp;__tn__=-]K-R">https://www.facebook.com/dieday.ec/</a></div><br>', '1-10', '01-08-2024 01:08 AM [EAT +03:00]', 'employer', 'www.diedaysoft.ec', '0da67e67b83cb20c8268e01d1bed4292', 'CM032372290');
